class Solution {
  int minOperations(List<int> nums) {
    Map<int, int> countMap = {};
    for (var num in nums) {
      countMap[num] = (countMap[num] ?? 0) + 1;
    }
    int operations = 0;
    for (var entry in countMap.entries) {
      int value = entry.value;
      operations += value ~/ 3; // For every three equal elements, it's one operation.
      operations += value % 3 == 0 ? 0 : 1; // If there's a remainder of 1 or 2, it requires an additional operation.
    }
    // Calculate the total elements removed in the optimal operations
    int totalElementsRemoved = countMap.entries.fold(0, (previousValue, element) => previousValue + (element.value ~/ 3) * 3 + ((element.value % 3) > 0 ? ((element.value % 3) == 2 ? 2 : 3) : 0));
    // If the total elements removed equals the length of the original array, return the operations, else it's not possible (-1)
    return totalElementsRemoved == nums.length ? operations : -1;
  }
}
